import React from 'react';
import API from './Api';

class BienesApi extends React.Component {
    
    async componentDidMount() {
        
        var headers = {
            'Accept': '*/*',
            'Accept-Encoding': 'gzip, deflate',
            'Accept-Language': 'en-GB, en; q=0.8, es-MX; q=0.5, es; q=0.2',
            'Cache-Control': 'no-cache',
            'Connection': 'Keep-Alive',
            'Content-Length': '99',
            'Content-Type': 'application/x-www-form-urlencoded; charset=UTF-8',
            'Cookie': 'JSESSIONID=MIaJ80Or2ZuZ-T8SgWF29_EsqhSqzTeaZtXatubMwtX5TcPtowSw!-1163771619',
            'Host': '127.0.0.1:7101',
            'Referer': 'http://127.0.0.1:7101/FiduciaWeb/principal.do',
            'User-Agent': 'Mozilla/4.0 (compatible; MSIE 6.0; Windows NT 5.1)',
            'X-Requested-With': 'XMLHttpRequest'
            }
        // Load async data.
            /*getRef.do?json={"id":"funRegistroGarantias"}*/
            //const response = await API.get('https://jsonplaceholder.typicode.com/todos/1');
        const response = API.get('getRef.do?json={"id":"funRegistroGarantias"}',{headers}).then(function (result){
            console.log('ðŸ‘‰ Returned data:', response);
        }).catch (function (error){
            console.log(`ðŸ˜± Axios request failed: ${error}`);
        });
    }
    render() {

        return (
            <div>
                Algo de AXIOS
                <br/>
            </div>
        );
    }
}
export default BienesApi;
